import React from 'react';

const ChileMap = ({ sensors, onSelectSensor }) => {
  return (
    <div className="bg-white shadow-md rounded-2xl p-4 h-full overflow-auto">
      <h2 className="text-xl font-bold mb-4 text-gray-800">Mapa de Sensores</h2>
      <div className="grid grid-cols-2 gap-4">
        {sensors.map((sensor) => (
          <div
            key={sensor.id}
            className={`border rounded-lg p-3 cursor-pointer transition hover:shadow-md ${
              sensor.status === 'alert' ? 'border-red-400 bg-red-50' : 'border-green-300 bg-green-50'
            }`}
            onClick={() => onSelectSensor(sensor)}
          >
            <p className="font-semibold">{sensor.name}</p>
            <p className="text-sm text-gray-600">Regi√≥n: {sensor.region}</p>
          </div>
        ))}
      </div>
    </div>
  );
};

export default ChileMap;
